import React from 'react';


function BeachCard(props) {
  return (
    <div className="Beach-Card" onClick={() => {props.selectBeach(props.beach.name)}}>
      <ul>
        <li>{props.beach.name}</li>
        Location: {props.beach.vicinity}
      </ul>
    </div>
  )
}
export default BeachCard
